import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

const Footer = () => {
  return (
    <Container>
      <Row>
        <Col className='text-center py-3'>Copyright &copy; Decofin</Col>
      </Row>
    </Container>
  )
}
export default Footer
